import { Route, Routes } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <div className="container">
      <h1>My shop</h1>
      <Routes>
        <Route path="/" element={<baseLayout />}></Route>
      </Routes>
    </div>
  );
}

export default App;
